import React, {Component} from "react";
import {classNames} from 'primereact/utils';
import {Card} from "primereact/card";
import {Button} from "primereact/button";
import {InputText} from "primereact/inputtext";

export class Rents extends Component {

    constructor(props) {
        super(props);

        this.state = {
            id_email:'',
            submitted: false
        }

        this.searchRent = this.searchRent.bind(this);
        this.hideDialog = this.hideDialog.bind(this);
    }

    onInputChange(e, name) {
        this.state['id_email'] = (e.target && e.target.value) || '';

    }

    searchRent(){
        console.log(this.state.id_email.toString());

        let state = { submitted: true };

        if (this.state.id_email.trim()) {
            let products = [...this.state.products];
            let product = {...this.state.product};
            if (this.state.product.id) {
                const index = this.findIndexById(this.state.product.id);

                products[index] = product;
                this.toast.show({ severity: 'success', summary: 'Successful', detail: 'Product Updated', life: 3000 });
            }
            else {
                product.id = this.createId();
                product.image = 'product-placeholder.svg';
                products.push(product);
                this.toast.show({ severity: 'success', summary: 'Successful', detail: 'Product Created', life: 3000 });
            }

            state = {
                ...state,
                products,
                productDialog: false,
                busqueda: this.emptyProduct
            };
        }

        this.setState(state);
    }

    hideDialog() {
        this.setState({
            submitted: false,
            productDialog: false
        });
    }

    render() {
        return (
            <div style={{width:'80%', margin:'0 auto', marginTop:'40px'}}>
                <Card title="My Rent" footer={this.footerCard}>
                    <div className="col-12 md:col-4">
                        <div className="field">
                            <label htmlFor="name">Name</label>
                            <InputText id="name" value={this.state.id_email} onChange={(e) => this.onInputChange(e, 'id_email')} required autoFocus className={classNames({ 'p-invalid': this.state.submitted && !this.state.id_email })} />
                            {this.state.submitted && !this.state.id_email && <small className="p-error">Name is required.</small>}
                        </div>

                        <div className="p-inputgroup">
                            <InputText id="id_email"
                                       onChange={(e) => this.onInputChange(e, 'id_email')}
                                       required autoFocus
                                       className={classNames({ 'p-invalid': this.state.submitted && !this.state.id_email })}/>
                            {this.state.submitted && !this.state.id_email && <small className="p-error">Id or email is required.</small>}
                            <Button icon="pi pi-search" className="p-button-success" onClick={this.searchRent}/>
                        </div>
                    </div>
                </Card>
            </div>
        );
    }
}

export default Rents;
